import React, { useState, useEffect } from "react";
import NProgress from "nprogress";
import Router from "next/router";
import Link from "next/link";
Router.onRouteChangeStart = (url) => NProgress.start();
Router.onRouteChangeComplete = (url) => NProgress.done();
Router.onRouteChangeError = (url) => NProgress.done();

const Header = () => {


  return (
    <React.Fragment>
      <header className="p-3 mb-3 border-bottom">
        <div className="container">
          <div className="d-flex flex-wrap align-items-center justify-content-center justify-content-lg-start">
            <a href="/" className="d-flex align-items-center mb-2 mb-lg-0  text-decoration-none">
              <svg className="bi me-2 text-dark" width={40} height={32} role="img" aria-label="Bootstrap"><use xlinkHref="#bootstrap" /></svg>
            </a>
            <ul className="nav col-12 col-lg-auto me-lg-auto mb-2 justify-content-center mb-md-0">
              <li><a href="#" className="nav-link px-2 link-secondary">Overview</a></li>
              <li><a href="#" className="nav-link px-2 link-dark">Inventory</a></li>
              <li><a href="#" className="nav-link px-2 link-dark">Customers</a></li>
              <li><a href="#" className="nav-link px-2 link-dark">Products</a></li>
            </ul>
            <form className="col-12 col-lg-auto mb-3 mb-lg-0 me-lg-3">
              <input type="search" className="form-control" placeholder="Search..." aria-label="Search" />
            </form>
            <div className="dropdown text-end">
              <a href="#" className="d-block link-dark text-decoration-none" id="dropdownUser1" data-bs-toggle="dropdown" aria-expanded="false">
                <img src="https://github.com/mdo.png" alt="mdo" width={32} height={32} className="rounded-circle" />
              </a>
            </div>
          </div>
        </div>
      </header>

    </React.Fragment>
  );
};

export default Header;
